import React from 'react'

import Vote from './Vote'
import CommentForm from './CommentForm'

export default function Comment({comment}) {
    console.log(comment)
    return (
        <div>
            <h5>{comment.body}</h5>
            <h6>{comment.author}</h6>
            <Vote score={comment.voteScore}/>
        </div>
    )
}
